import './ListItem.css'
import { AiOutlineCheck } from 'react-icons/ai';

const ListItem = () => {
  return (
    <div className="todo_list">
        <div className='todo_check'>
            <AiOutlineCheck />
        </div>
        <div className='todo_text'>
            Testing text
        </div>
    </div>
  )
}

export default ListItem
